import pandas as pd, urllib
from bs4 import BeautifulSoup
import streamlit as st, pickle, numpy as np

def sayfaHTMLDondur2(url):
    request_site = urllib.request.Request(url, headers={"User-Agent": "Mozilla/5.0"})
    htmlMetin = urllib.request.urlopen(request_site).read()
    metin = BeautifulSoup(htmlMetin, "lxml").text.strip()
    return metin

def predict_text(text, ekOznitelikler, tahminTuru):
    # Modeli yükle, Öznitelik çıkarma ve sınıflandırma modellerini yükle
    with open(f'modelVectorizer_{tahminTuru}.pkl', 'rb') as f:
        doc2vec_model = pickle.load(f)
    with open(f'modelClassifier_{tahminTuru}.pkl', 'rb') as f:
        classifier_model = pickle.load(f)

    # Öznitelik çıkarma modelini kullanarak vektörü oluştur
    vector = doc2vec_model.infer_vector(text.split())
    vector = np.append(vector,ekOznitelikler)
    # Sınıflandırma modelini kullanarak tahmin yap
    prediction = classifier_model.predict([vector])[0]
    return prediction

